// FileList.js

import React, { useState } from 'react';
import FileUploader from './FileUploader';

const FileList = () => {
  // Initialize the state to hold the list of files
  const [files, setFiles] = useState([]);

  // Handler that updates the state with the new file
  const handleUploadSuccess = (fileName, date) => {
    setFiles((prevFiles) => [...prevFiles, { name: fileName, date: date }]);
  };

  return (
    <div>
      {/* File Uploader component */}
      <FileUploader onUploadSuccess={handleUploadSuccess} />

      {/* List of uploaded files */}
      {files.length > 0 && (
        <ul>
          {files.map((file, index) => (
            <li key={index}>
              {file.name} - {file.date}
            </li>
          ))}
        </ul>
      )}

      {/* If there are no files, show a message */}
      {files.length === 0 && <p>No files uploaded yet.</p>}
    </div>
  );
};

export default FileList;
